export function preOrderTraverse(
    node, childrenKey, callback, depth = 0, parentNode = null
): void | boolean {

    if (callback(node, parentNode, depth) === false) {
        return false;
    }

    if (node?.[childrenKey] && node[childrenKey].length > 0) {
        for (let i = 0, len = node[childrenKey].length; i < len; i++) {
            if (preOrderTraverse(node[childrenKey][i], childrenKey, callback, depth + 1, node) === false) {
                return false;
            }
        }
    }

}

/**
 * Get select all value when showCheckedStrategy === AntCascader.SHOW_CHILD
 * @param options
 * @param valueKey
 * @param childrenKey
 * @param valuePath
 */
export function getSelectAllValue(options, valueKey, childrenKey, valuePath = []) {

    if (!options || options.length < 1) {
        return [];
    }

    return options.reduce((result, option) => {

        const nextResult = [
            ...result
        ];

        const value = option?.[valueKey];
        const nextValuePath = [...valuePath, value];

        if (option?.[childrenKey]?.length > 0) {
            nextResult.push(...getSelectAllValue(option?.[childrenKey], valueKey, childrenKey, nextValuePath));
        } else {
            nextResult.push(nextValuePath);
        }

        return nextResult;

    }, []);

}
