// Hooks
import {useMemo} from 'react';

// Types
import {CascaderProps} from '../Cascader';

// Utils
import {getSelectAllValue} from '../Util';

// Components
import {Cascader as AntCascader} from 'antd';

export type UseSelectAll = Pick<CascaderProps, 'loadData' | 'options' | 'value' | 'showCheckedStrategy'> & {
    valueKey: string,
    childrenKey: string
}

// \u627E\u4E00\u4E2A\u4E0D\u4F1A\u88ABvalue\u4F7F\u7528\u7684\u5206\u9694\u7B26
const joinSignal = '\u266A';

// \u5F53\u6240\u6709options\u7684value\u62FC\u7684key\uFF0C\u5728valueMap\u91CC\u90FD\u80FD\u627E\u5230\uFF0C\u5219\u89C6\u4E3A\u5168\u9009\u4E86\u3002
const useSelectAll = (props: UseSelectAll) => {

    const {loadData, options = [], value, showCheckedStrategy, valueKey, childrenKey} = props;

    const allValue = useMemo<(string | number)[][]>(() => {
        if (showCheckedStrategy === AntCascader.SHOW_PARENT) {
            return (options.map(option => [option?.[valueKey]]));
        } else if (showCheckedStrategy === AntCascader.SHOW_CHILD) {
            return (getSelectAllValue(options, valueKey, childrenKey));
        }
    }, [childrenKey, options, showCheckedStrategy, valueKey]);

    const valueMap = useMemo(() => {
        return (value as (string | number)[][])?.reduce((v, i) => {
            v[i.join(joinSignal)] = true;
            return v;
        }, {}) ?? {};
    }, [value]);

    const showSelectAll = useMemo(() => typeof loadData === 'undefined', [loadData]);

    // \u5B58\u5728options,\u4E14options\u5185\u6240\u6709\u7684\u503C\u90FD\u80FD\u5728 \u4F20\u5165\u7684value\u91CC\u627E\u5230\u3002
    const selectAll = useMemo(() => allValue?.length > 0 && allValue?.every(i => valueMap[i.join(joinSignal)]), [allValue, valueMap]);

    // \u5B58\u5728options,\u4E14\u6CA1\u6709\u5168\u9009\uFF0C\u4E14value.length>0\u3002
    const indeterminate = useMemo(() => allValue?.length > 0 && !selectAll && value?.length > 0, [allValue, selectAll, value?.length]);

    return {
        showSelectAll, selectAll, indeterminate
    };

};

export default useSelectAll;
