import {FC} from 'react';

// Hooks
import {useCallback} from 'react';

// Components
import Checkbox from '../../Checkbox';

export interface SelectAllProps {

    disabled?: boolean;

    checked?: boolean;
    indeterminate?: boolean;

    onSelectAll?: () => void;
    onDeselectAll?: () => void;

}

const SelectAll: FC<SelectAllProps> = ({disabled, checked, indeterminate, onSelectAll, onDeselectAll}) => {

    /**
     * Handle select all checkbox changed
     */
    const handleSelectAllChanged = useCallback(e => {
        const checked = e.target.checked;
        if (checked) {
            onSelectAll?.();
        } else {
            onDeselectAll?.();
        }
    }, [
        onSelectAll, onDeselectAll
    ]);

    return (
        <Checkbox
            disabled={disabled}
            checked={checked}
            indeterminate={indeterminate}
            onChange={handleSelectAllChanged}>
            Select All
        </Checkbox>
    );

};

export default SelectAll;
