// Components
import { Modal as AntModal } from 'antd';

// Hooks
import { useState } from 'react';

// Utils
import { commonConfigSet, confirmConfigSet } from '../utils';

// instance \u4E0A\u9700\u8981\u62E6\u622A\u7684\u65B9\u6CD5\u540D
const type = ['info', 'success', 'error', 'warning', 'confirm'];

// \u914D\u7F6Eproxy \uFF0C\u62E6\u622Amodal\u65B9\u6CD5
const createProxyHandler = () => {

    return {
        get: function (target, prop, receiver) {
            if (type.includes(prop)) {
                // confirm \u9700\u8981\u7279\u6B8A\u5904\u7406
                if (prop === 'confirm') {
                    return confirmConfigSet(target[prop]);
                }
                return commonConfigSet(target[prop]);
            }
            // \u5BF9\u4E8E\u5176\u4ED6\u5C5E\u6027\uFF0C\u76F4\u63A5\u8FD4\u56DE\u76EE\u6807\u503C
            return Reflect.get(target, prop, receiver);
        }
    };

};

const useInternalModal = () => {
    const [modalInstance, contextHolder] = AntModal.useModal();

    const [cloneModalInstance] = useState(() => {
        return new Proxy<typeof modalInstance>(modalInstance, createProxyHandler());
    });

    return [cloneModalInstance, contextHolder] as const;
};

export default useInternalModal;
