export interface SelectAllAcrossPagesAllOptions<T> extends SelectAllAcrossPagesOptions {
    // table select \u914D\u7F6E
    rowSelection?: TableProps<T>['rowSelection'],
    // \u5F53\u524D\u6570\u636E
    dataSource?: TableProps<T>['dataSource'],
    rowKey?: TableProps<T>['rowKey']
}

const useSelectAllAcrossPages = <T>(options: SelectAllAcrossPagesAllOptions<T>) => {
    const { rowSelection, dataSource = [], rowKey = 'id', ...selectAllAcrossPagesOptions } = options
    const { canSelectAllAcrossPages, needSelectedTotalNumber } = selectAllAcrossPagesOptions
    // \u5BF9\u914D\u7F6E\u4E2D\u9ED8\u8BA4\u7684\u52FE\u9009\u505A\u4EE3\u7406
    const { value: selectedRowKeys, onChange } = useFieldControlled({ value: rowSelection?.selectedRowKeys, defaultValue: [], onChange: rowSelection?.onChange })

    const { value: selectAllAcrossPages, onChange: onChangeSelectAllAcrossPages } = useFieldControlled(Object.assign({ defaultValue: false, onChange: selectAllAcrossPagesOptions.onChangeSelectAllAcrossPages }, Object.hasOwn(selectAllAcrossPagesOptions, 'selectAllAcrossPages') ? { value: selectAllAcrossPagesOptions.selectAllAcrossPages } : {}))

    const newSelectedRowKeys = useMemo(() => canSelectAllAcrossPages && selectAllAcrossPages ? dataSource.filter(item => {
        const props = rowSelection?.getCheckboxProps?.(item) ?? {}
        if (props.disabled) {
            return selectedRowKeys.includes(item[rowKey as string])
        } else {
            return true
        }
    }).map(item => item[rowKey as string]) : selectedRowKeys, [canSelectAllAcrossPages, dataSource, rowKey, rowSelection, selectAllAcrossPages, selectedRowKeys])

    const newGetCheckboxProps = useMemo(() => {
        return canSelectAllAcrossPages ? (record: T) => {
            const props = rowSelection?.getCheckboxProps?.(record)
            return selectAllAcrossPages ? {
                ...props,
                disabled: true
            } : props
        } : rowSelection?.getCheckboxProps
    }, [canSelectAllAcrossPages, rowSelection, selectAllAcrossPages])

    const newRowSelection = useMemo(() => {
        // \u5F53\u914D\u7F6E\u4E86rowSelection \u4E14\u652F\u6301 \u8DE8\u9875\u9009\u62E9\u624D\u9700\u8981\u5C06\u5C01\u88C5\u7684\u629B\u51FA\u53BB
        return typeof rowSelection === 'object' && canSelectAllAcrossPages ? {
            ...rowSelection,
            getCheckboxProps: newGetCheckboxProps,
            selectedRowKeys: newSelectedRowKeys,
            onChange
        } : rowSelection
    }, [rowSelection, canSelectAllAcrossPages, newGetCheckboxProps, newSelectedRowKeys, onChange])

    return {
        rowSelection: newRowSelection,
        canSelectAllAcrossPages,
        needSelectedTotalNumber,
        selectAllAcrossPages,
        onChangeSelectAllAcrossPages
    }
}

export default useSelectAllAcrossPages
