// Hooks
import {useState, useMemo, useEffect, useCallback, useRef} from 'react';

export interface OnChangeInterFace<T> {
    (value: T, ...rest: any[]): void;
}

export interface UseControlProps<T, U extends OnChangeInterFace<T>> {
    value?: T;
    defaultValue?: T;
    onChange?: U;

    [key: string]: any;
}

/**
 * @description \u7528\u4E8E\u7F16\u5199\u540C\u65F6\u5177\u6709\u53D7\u63A7\u7EC4\u4EF6\u4E0E\u975E\u53D7\u63A7\u7EC4\u4EF6\u4E24\u79CD\u6A21\u5F0F\u7684\u7EC4\u4EF6\uFF0C\u5BF9\u5B57\u6BB5 {value} \u4E0E {onChange}\u8FDB\u884C\u5305\u88C5\u3002
 */
const useFieldControlled = <T, U extends OnChangeInterFace<T>>(
    props: UseControlProps<T, U>
) => {

    const {value: propsValue, defaultValue, onChange} = props;
    const onChangeRef = useRef<U>();

    useEffect(() => {
        onChangeRef.current = onChange;
    });

    const [
        localValue, setLocalValue
    ] = useState<T | undefined>(() => defaultValue);

    const controlled = useMemo(() => {
        return Object.prototype.hasOwnProperty.call(props, 'value');
    }, [
        props
    ]);

    const value = useMemo(() => {
        return controlled ? propsValue : localValue;
    }, [
        controlled, propsValue, localValue
    ]);

    const handleChangeValue: OnChangeInterFace<T> = useCallback((value, ...rest) => {
        if (!controlled) {
            setLocalValue(value);
        }
        onChangeRef.current?.(value, ...rest);
    }, [
        controlled
    ]);

    return {
        value,
        onChange: handleChangeValue as U
    };

};

export default useFieldControlled;
