import {useState, useMemo, useEffect, useCallback, useRef} from 'react';

// Types
import type {SelectEventHandler} from 'rc-menu/es/interface';

export interface UseControlProps {
    selectedKeys?: string[];
    defaultSelectedKeys?: string[];
    onSelect?: SelectEventHandler;
    onDeselect?: SelectEventHandler;

    [key: string]: any;
}

const useSelectedControlled = (
    props: UseControlProps
) => {

    const {selectedKeys: propsValue, defaultSelectedKeys, onSelect, onDeselect} = props;
    const onSelectRef = useRef<SelectEventHandler>();
    const onDeselectRef = useRef<SelectEventHandler>();

    useEffect(() => {
        onSelectRef.current = onSelect;
    });

    useEffect(() => {
        onDeselectRef.current = onDeselect;
    });

    const [localValue, setLocalValue] = useState<string[] | undefined>(() =>
        defaultSelectedKeys
    );

    const controlled = useMemo(() => {
        // eslint-disable-next-line no-prototype-builtins
        return props.hasOwnProperty('selectedKeys');
    }, [
        props
    ]);

    const selectedKeys = useMemo(() => {
        return controlled ? propsValue : localValue;
    }, [
        controlled, propsValue, localValue
    ]);

    const handleSelect: SelectEventHandler = useCallback((info) => {
        if (!controlled) {
            setLocalValue(info?.selectedKeys);
        }
        onSelectRef.current?.(info);
    }, [
        controlled
    ]);

    const handleDeselect: SelectEventHandler = useCallback((info) => {
        if (!controlled) {
            setLocalValue(info?.selectedKeys);
        }
        onDeselectRef.current?.(info);
    }, [
        controlled
    ]);

    return {
        selectedKeys,
        onSelect: handleSelect,
        onDeselect: handleDeselect
    };

};

export default useSelectedControlled;
